import React from "react";
import { api } from "../../utils/api";

type Props = {
    label: string;
    handleSubmit: Function;
};

export default function Button({ label, handleSubmit }: Props) {
    const handleButtonSubmit = (event: React.FormEvent<HTMLButtonElement>) => {
        event.preventDefault();
        handleSubmit();
    };

    return (
        <button
            onSubmit={(event) => handleButtonSubmit(event)}
            className="button"
        >
            {label}
        </button>
    );
}
